  return (
    <div class="header__logo">
      <img alt={props.assistiveText} className="header__logoSVG" src={logo}></img>
      <h5><span className='mediumText'>WINDOW<br></br>NEWS</span></h5>
    </div>
  );
}


export default Logo;
